import React, { useState } from 'react';
import { ModalWrapper, ModalBox } from './styles';

const Modal = ({ children, open, onClose }) => {
  return (
    <ModalWrapper open={modalOpen} onClick={onClose}>
      <ModalBox>{children}</ModalBox>
    </ModalWrapper>
  );
};

export default Modal;
